import express from 'express';
import expressAsyncHandler from 'express-async-handler';
import Order from '../models/orderModel';
import mongoose from 'mongoose';
import { isAdmin, isAuth, seller } from '../util';
import razorpay from "razorpay";

const orderRouter =express.Router();

orderRouter.get ('/mine' ,isAuth , expressAsyncHandler( async (req ,res)=>{

    const orders = await Order.find({user: req.user._id})

    res.send(orders)


}) )



orderRouter.post('/' ,isAuth, expressAsyncHandler(async (req , res )=>{
    if (req.body.orderItems===0){
        res.status(400).send({msg : "cart is empty"});
    }
    else{
        const order =new Order(
            {
                orderItems : req .body.orderItems,
                shipping : req .body.shipping,
                payment : req .body.payment,
                itemsPrice : req .body.itemsPrice,
                shippingPrice : req .body.shippingPrice,
                taxPrice : req .body.taxPrice,
                totalPrice : req .body.totalPrice,
                user : req.user._id,
                

            }
        );
        const createdOrder =  await order.save();
        res.status(201).send({msg : 'Order created ' , order : createdOrder});        
    }
}));



orderRouter.get('/:id' ,isAuth, expressAsyncHandler(async (req , res )=>{
    
    const order = await Order.findOne({_id :req.params.id});
   
        
    if (order){
        
        res.send(order);

    }
    else{
        res.status(404).send({msg : "order not found"})
    }
}));

orderRouter.get("/:id/pay/:payment/:order/:sign", expressAsyncHandler(async (req , res)=>{

    const orderId= req.params.order

    const sign= req.params.sign

    const payment = req.params.payment

/* generated_signature = hmac_sha256(order+ "|" + razorpay_payment_id, secret);

  if (generated_signature == razorpay_signature) {
    console.log("paid...!!")
  } */
    
    try {
        const order = await Order.findById(req.params.id);
        
        
        if(order){
            order.isPaid = true;
            order.paidAt = Date.now();  
            order.paymentResult = { 
                //payment_id : req.body.response.razorpay_payment_id , 
                payment_id : payment , 
                //order_id : req.body.response.razorpay_order_id ,
                order_id : orderId ,
                status :"success" , 
                updated_time : Date.now() , 
                signature : sign
            } 
        
        const updatedOrder = await order.save();
    
        res.send({message :"Order paid" , order : updatedOrder})
        }else{
            res.status(500).send({msg : "order not found" });
        }
    } catch (error) {
        res.send({message : error.message})
    }
    

}))





export default orderRouter;

